Write a Groovy program that uses a linked list data structure to implement a stack. The program should be able to perform the following stack operations: push (add an element to the top of the stack), pop (remove and return the top element from the stack), and peek (return the top element without removing it). Use object-oriented programming principles to design your implementation. Include comments explaining your code.
Here is a possible implementation of a stack based on a linked list:
class Stack {
    def reverseOrder = new LinkedList<Integer>()
    def isEmpty() { reverseOrder.size() == 0 }
    def pop() { reverseOrder.removeLast() }
    def peek() { reverseOrder.getLast() }
    def push(value) { reverseOrder.addLast(value) }
Examining the implementation above, we can see how it utilizes the LinkedList data structure to store and manipulate the elements in the stack. The stack itself is an instance of a LinkedList object, which allows us to easily add, remove, and retrieve elements

